webpackJsonp([62146069567272],{362:function(e,o){e.exports={data:{page:{frontmatter:{title:"",include:null},headings:[{depth:1,value:"Configuration"},{depth:3,value:"Video sources"},{depth:3,value:"Playback attributes"},{depth:3,value:"Size"},{depth:3,value:"Screen"},{depth:3,value:"Title"},{depth:3,value:"Controls"},{depth:3,value:"Overlay"},{depth:3,value:"FullScreen"},{depth:3,value:"Logo"},{depth:3,value:"Other"}],html:'<h1 id="configuration"><a href="#configuration" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Configuration</h1>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token keyword">const</span> config <span class="token operator">=</span> <span class="token punctuation">{</span>\n   src<span class="token punctuation">:</span> <span class="token punctuation">[</span>\n     <span class="token string">\'http://my-url/video.mp4\'</span><span class="token punctuation">,</span>\n     <span class="token string">\'http://my-url/video.webm\'</span><span class="token punctuation">,</span>\n     <span class="token string">\'http://my-url/video.m3u8\'</span>\n   <span class="token punctuation">]</span><span class="token punctuation">,</span>\n\n   loop<span class="token punctuation">:</span> <span class="token boolean">true</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n<span class="token keyword">const</span> player <span class="token operator">=</span> VideoPlayer<span class="token punctuation">.</span><span class="token function">create</span><span class="token punctuation">(</span>config<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<h3 id="video-sources"><a href="#video-sources" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Video sources</h3>\n<p><code>config.src: MediaSource</code> A string or array with source of the video. For more information see <a href="/docs/video-source">this page</a></p>\n<h3 id="playback-attributes"><a href="#playback-attributes" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Playback attributes</h3>\n<p><code>config.loop: Boolean</code> Loop video playback</p>\n<p><code>config.autoPlay: Boolean</code> Start video playback as soon as it can do so without stopping to finish loading the data</p>\n<p><code>config.preload: OneOf(\'auto\', \'metadata\', \'none\')</code> Type of preloading. For more info check (<a href="https://developer.mozilla.org/en/docs/Web/HTML/Element/video" target="_blank" rel="nofollow noopener noreferrer">MDN</a>)</p>\n<p><code>config.muted: Boolean</code> Status of audio playback. If set, the audio will be initially silenced</p>\n<p><code>config.volume: Number&#x3C;0..100></code> Start value of volume for audio</p>\n<h3 id="size"><a href="#size" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Size</h3>\n<p><code>config.size.width: Number</code> Width of video player</p>\n<p><code>config.size.height: Number</code> Height of video player</p>\n<h3 id="screen"><a href="#screen" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Screen</h3>\n<p><code>config.screen.disableClickProcessing: Boolean</code> Pass <code>true</code> to disable control of player through click on screen</p>\n<p><code>config.screen.indicateScreenClick: Boolean</code> Pass <code>false</code> to disable screen indication of user interaction with player</p>\n<p><code>config.screen.nativeControls: Boolean</code> Pass <code>true</code> to show native browser controls</p>\n<h3 id="title"><a href="#title" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Title</h3>\n<p><code>config.title: Boolean | ITitleConfig</code> Pass <code>false</code> to hide title</p>\n<p><code>config.title.callback: Function</code> Function that would be called when user clicks on title</p>\n<p><code>config.title.text: String</code> String that would be shown as title of video.</p>\n<h3 id="controls"><a href="#controls" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Controls</h3>\n<p><code>config.controls: Boolean | IControlsConfig</code> Pass <code>false</code> to hide controls</p>\n<p><code>config.controls.shouldAlwaysShow: Boolean</code> Pass <code>true</code> for alowing controls to be visible no matter of what</p>\n<h3 id="overlay"><a href="#overlay" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Overlay</h3>\n<p><code>config.overlay: Boolean | IOverlayConfig</code> Pass <code>false</code> to hide overlay</p>\n<p><code>config.overlay.poster: String</code> URL to image that would be used as poster on overlay</p>\n<h3 id="fullscreen"><a href="#fullscreen" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>FullScreen</h3>\n<p><code>config.fullScreen: Boolean | IFullScreenConfig</code> Pass <code>false</code> to disable full screen functionality</p>\n<p><code>config.fullScreen.exitFullScreenOnEnd: Boolean</code> Pass <code>true</code> to alow player exit full screen after video ends.</p>\n<p><code>config.fullScreen.enterFullScreenOnPlay: Boolean</code> Pass <code>true</code> to alow player enter full screen after video starts playing.</p>\n<p><code>config.fullScreen.exitFullScreenOnPause: Boolean</code> Pass <code>true</code> to alow player exit full screen after video pauses.</p>\n<p><code>config.fullScreen.pauseVideoOnFullScreenExit: Boolean</code> Pass <code>true</code> to alow player pause video after exit from full screen.</p>\n<h3 id="logo"><a href="#logo" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Logo</h3>\n<p><code>config.logo: Boolean | ILogoConfig</code> Pass <code>false</code> to hide logo</p>\n<p><code>config.logo.callback: Function</code> Function that would be called when user clicks on logo</p>\n<p><code>config.logo.src: String</code> URL to image that would be used as logo</p>\n<p><code>config.logo.showAlways: Boolean</code> Pass <code>true</code> to alow logo be visible no matter or what</p>\n<h3 id="other"><a href="#other" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Other</h3>\n<p><code>config.playInline: Boolean</code> Attribute for playing inline in iOS</p>\n<p><code>config.loader: Boolean</code> Pass <code>false</code> to hide loader</p>\n<p><code>config.texts: ITextMapConfig</code> Gives you ability to override texts, that are used in player</p>\n<p><code>config.disableControlWithKeyboard: Boolean</code> Pass <code>false</code> to disable ability to control player through keyboard</p>\n<p><code>config.fillAllSpace: Boolean</code> Pass <code>true</code> to alow player fill all space of it container</p>'}},pathContext:{slug:"docs/player-config/"}}}});
